INSERT INTO `TaiNguyenSach` VALUES (1,'B Lut Hnh S Hin Hnh (B Lut Nm 2015, Sa i, B Sung Nm 2017)','NXB Chnh Tr Quc Gia S Tht',2017,'Ting Vit','B Lut Hnh S Hin Hnh (B Lut Nm 2015, Sa i, B Sung Nm 2017) vi cc quy nh mi v ti phm; nhng trng hp loi tr trch nhim hnh s; thi hiu truy cu trch nhim hnh B lut hnh s c p dng i vi mi hnh vi phm ti thc hin trn lnh th nc Cng ha x hi ch ngha Vit Nam.','LVBL',3,'302','302-1'),(2,'B Lut Dn S (Hin Hnh)','NXB Chnh Tr Quc Gia S Tht',2019,'Ting Vit','B lut dn s bao gm 689 iu, c nhng ni dung ni bt v chuyn i gii tnh. Thc hin hp ng khi hon cnh thay i c bn. Cc ngha v ti sn v cc khon chi ph lin quan n tha k...','LVBL',3,'302','302-1'),(3,'Hng Dn Thi Hnh Lut t ai  Lut Nh   Tng Cng Chn Chnh Cng Tc Qun L Nh Nc V Gi t, Tin Thu t, Cp i S, Bi Thng, H Tr, Ti nh C Khi Nh Nc Thu Hi t','NXB Lao ng',2021,'Ting Vit','Ngy 04-5-2021, B Ti nguyn v Mi trng ban hnh Vn bn hp nht s 04/VBHN-BTNMT Hp nht Ngh nh quy nh chi tit thi hnh mt s iu ca Lut t ai. Ngy 26-3-2021, Chnh ph ban hnh Ngh nh 30/2021/N-CP sa i, b sung mt s iu ca Ngh nh 99/2015/N-CP quy nh chi tit v hng dn thi hnh mt s iu ca Lut Nh . Theo : B sung quy nh v vic iu chnh chng trnh, k hoch pht trin nh  ca a phng; Sa quy nh v ly  kin thm nh ca c quan nh nc v nh  i vi d n u t xy dng nh , cc trng hp la chn ch u t d n xy dng nh  thng mi, d n khu  thi c nh, bn giao kinh ph bo tr phn s hu chung ca nh chung c c nhiu ch s hu','LVBL',3,'302','302-1'),(4,'Nhn Din Ri Ro Trong Mua Bn Nh t','NXB Chnh Tr Quc Gia S Tht',2021,'Ting Vit','Hin nay, nhu cu v nh t ngy mt gia tng, th trng bt ng sn nc ta v cng si ng, c sc ht ln i vi cc nh u t. Tuy nhin, v nhng l do khc nhau, trong giao dch mua bn nh t, nhiu ngi cha nm vng cc quy nh ca php lut nn d gp phi ri ro php l, thit hi v ti sn trong vic chuyn nhng, nhn chuyn nhng nh , quyn s dng t (mua bn nh t).','LVBL',3,'302','302-1'),(5,'Thi Dng ng','NXB Tng hp TP.HCM',2013,'Ting Vit','C mt thi k thai nghn, mang nng,  au,  quyt nh tnh cht v vai tr ca ng, hng i ln chnh xc ca t nc, ci kin v ci cng ca phong tro,  vng v sc bt ca dn tc v mi con ngi... Lc ny y, ang c mt s khao kht tr v ngun  bi dng cho mnh sc mnh i ti, khi n lt chng ta y vn cao ln  gii quyt tng hp nhng nhim v nng n v rng ln ca thi k mi, trc tip thc hin nhng iu m c - v n m sng v cht - ca nhng ngi cng sn Vit Nam thuc lp u tin','LLCT',3,'302','302-1'),(6,'Ch Dn p Dng Lut t ai V Vn Bn Hng Dn Chi Tit Thi Hnh (Theo Ngh nh s 148/2020/N-CP ngy 18/12/2020)','NXB Hng c',2021,'Ting Vit','Nhm gip cc t chc, c nhn tm hiu v p dng ng nhng quy nh mi nht ca Nh nc v t ai, c th: Nhng hnh vi vi phm php lut v t ai, xy dng, nh ; nhng quy nh v xc nh gi t; thu tin thu t, s dng t; quy nh v qun l, s dng t trng la;Nh xut bn Hng c phi hp cng vi gii thiu cun sch: Ch Dn p Dng Lut t ai V Vn Bn Hng Dn Chi Tit Thi Hnh (Theo Ngh nh s 148/2020/N-CP ngy 18/12/2020)','LVBL',3,'302','302-1'),(7,'T in php lut Vit Nam','NXB Th Gii',2020,'Ting Vit','Vi mong mun c mt cun sch c th p ng nhu cu tm hiu cc t ng php lut mt cch c h thng, nhm to thun li cho nhng ngi lm cng tc nghin cu, hc tp v p dng php lut, tc gi  dnh thi gian hn 20 nm vi nhiu tm huyt  thu thp, su tm v bin son cun sch ny. C th ni y l cng trnh mang tnh khoa hc c gi tr, c bin son kh cng phu vi s lng t ng php lut Vit Nam nhiu nht cho n thi im hin ti (5.665 t). ng thi y cng l cun T in php lut u tin ca Vit Nam do mt c nhn bin son.','LVBL',3,'302','302-1'),(8,'Phng Php Nghin Cu V nh Gi Chng C Trong T Tng Hnh S V Cc Vn Bn Hng Dn Thi Hnh B Lut T Tng Hnh S Mi Nht','NXB Lao ng',2019,'Ting Vit','Trong t tng hnh s th hot ng nghin cu, nh gi chng c c vai tr rt quan trng, y l nhng hot ng trng tm ca t tng hnh s. Bi l tt c cc hot ng t tng hnh s  giai on iu tra, truy t, xt x xt cho cng u phi i n kt lun v gi tr chng minh ca chng c, trn c s  mi c th chng minh mt ti phm no   c thc hin v ai l ngi  thc hin ti phm . Vn  nghin cu, nh gi chng c tuy khng c quy nh c th thnh mt quy trnh trong B lut T tng hnh s m ch quy nh mang tnh nguyn tc chung, nhng v php l th tt c cc hot ng t tng hnh s bao gm c hot ng nghin cu, nh gi chng c thc cht l  chng minh ti phm v x l ngi phm ti theo nhng ti danh c quy nh c th trong B lut Hnh s.','LVBL',3,'302','302-1'),(9,'Phng Php nh Ti Danh Vi 538 Ti Phm Quy nh Trong B Lut Hnh S Nm 2015, c Sa i, B Sung Nm 2017 (Ti Bn C B Sung)','NXB Lao ng',2017,'Ting Vit','Trong t tng hnh s th hot ng nh ti danh c vai tr rt quan trng, n l trng tm m cc hot ng t tng khc hng ti, bi l tt c cc hot ng t tung hnh s  giai on iu tra, truy t, xt x xt cho cng u phi i n kt lun v mt ti phm no   xy ra v ai l ngi  thc hin ti phm hay khng thc hin ti phm .','LVBL',3,'302','302-1'),(10,'Spy X Family Tp 6','NXB Kim ng',2021,'Ting Vit','Nhn nhim v ly trm vn kin mt v cuc chin, Twilight v Nightfall phi tham chin trong i hi ngm di lng t!! Nhng Nightfall, mt ngi m thm ngng m Loid v lun cho rng mnh ph hp vi vai tr ngi v hn ai ht,  khin v chng nh Forger ri vo tnh cnh nguy him!?','TTMC',1,'101','101-1'),(11,'Spy X Family Tp 5','NXB Kim ng',2021,'Ting Vit','Ch ch c kh nng tin on tng lai, Bond  tr thnh mt thnh vin trong gia nh. Nhng tng chin dch Strix cng nh gia nh Forger  i vo qu o, nhng Anya li lm vo khng hong khi i mt vi bi thi gia k!?','TTMC',1,'101','101-1'),(12,'Cabins','Taschen',2020,'Ting Anh','rong thp k qua, khi s tn ti vt cht v du n mi trng ca chng ta  pht trin theo cp s nhn, cc kin trc s trn ton cu  c bit quan tm n cc kh nng ca ni  ti thiu, t tc ng v bit lp. v cc minh ha ng i, ti sng ca Marie-Laure Cruschi, khm ph cch loi kin trc c bit ny to ra nhng c hi c bit cho t duy sng to.  trnh s d tha, cabin hn ch s xm nhp khng gian thc t i vi cc nhu cu thit yu ca cuc sng, trong khi p ng vi khung cnh mc mc in hnh ca n, n a ra cc gii php thn thin vi mi trng.','MTKT',1,'101','101-4'),(13,'Wordsworth Editions: The Little Prince','Wordsworth Editions Ltd',1999,'Ting Anh','The Little Prince is a classic tale of equal appeal to children and adults. On one level it is the story of an airman\'s discovery, in the desert, of a small boy from another planet - the Little Prince of the title - and his stories of intergalactic travel, while on the other hand it is a thought-provoking allegory of the human condition. First published in 1943, the year before the author\'s death in action, this translation contains Saint-Exupery\'s delightful illustrations.','TPKD',1,'102','102-3'),(14,'Pride And Prejudice','Wordsworth Editions Ltd',1999,'Ting Anh','Rejection, regret and realizationa not every love story unfolds this way, but that\'s what makes Pride and Prejudice unforgettable.One of the most beloved books of all time, Pride and Prejudice - Jane Austen\'s most popular book- has been resonating with readers since it was first published in 1813 and has been adapated many times for television, movies, and books. When headstrong and independent Elizabeth Bennet, one of five sisters, is required to find a wealthy husband, her encounter with the arrogant Mr. Darcy leads to one of the most entertaining and satisfying courtships ever imagined.','TPKD',1,'102','102-3'),(15,'The Scarlet Letter','Wordsworth Editions Ltd',1999,'Ting Anh','Delve into a psychological romance for all time through Hawthorne\'s meditation on human alienation and its effect on the soul.In Nathaniel Hawthorne\'s dark novel, \"The Scarlet Letter,\" a single sinful act ruins the lives of three people. None more so than Hester Prynne, a young, beautiful, and dignified woman, who conceived a child out of wedlock and receives the public punishment of having to always wear a scarlet \"A\" on her clothing. She refuses to reveal the father of her child, which could lighten her sentence. Her husband, the aptly-named Roger Chillingworth, who Hester thought had died in a shipwreck but was actually being held captive by Native Americans, arrives at the exact moment of her deepest public shaming and vows to get revenge. Her lover, Arthur Dimmesdale, remains safely unidentified, but is wracked with guilt.','TPKD',1,'102','102-3'),(16,'Oxford Learner\'s Pocket Dictionary : A Pocket-sized Reference to English Vocabulary (Fourth Edition)','Oxford University Press',2008,'Ting Anh','The Oxford Learner\'s Pocket Dictionary has over 38,000 words, phrases, and meanings giving students a handy quick-reference guide to basic English vocabulary. It includes essential information on meanings, grammar patterns, spelling, idioms, and phrasal verbs.','TDTA',3,'301','301-1'),(17,'Me Before You (Paperback)','Penguin Random House',2017,'Ting Anh','From the #1 New York Times bestselling author of The Giver of Stars, discover the love story that captured over 20 million hearts in Me Before You, After You, and Still Me. ','TNT',1,'102','102-2'),(18,'Chicken Soup for the Soul: Thanks to My Mom: 101 Stories of Gratitude, Love, and Lessons','Simon & Schuster',2008,'Ting Anh','A mother\'s job is never done, but in Chicken Soup for the Soul: Thanks to My Mom, she gets the praise she deserves! Children of all ages share their words of thanks in these 101 stories of love, learning, and gratitude to the woman they couldn\'t have done without!','SLCLM',1,'101','101-4'),(19,'How To Win Friends And Influence People (Mass Market Paperback)','Penguin Random House',2004,'Ting Anh','For more than sixty years the rock-solid, time-tested advice in this book has carried thousands of now famous people up the ladder of success in their business and personal lives. Now this previously revised and updated bestseller is available in trade paperback for the first time to help you achieve your maximum potential throughout the next century!','HNKNM',3,'302','302-3'),(20,'How to be More Interesting','Penguin Random House',2004,'Ting Anh','Simple exercises to become the most interesting version of yourself, from the internationally bestselling and world-renowned philosopher and author, Edward de Bono.','HNKNM',3,'302','302-3'),(21,'The Happiness Curve','Bloomsbury',2008,'Ting Anh','This book will change your life by showing you how life changes. Why does happiness get harder in your 40s? Why do you feel in a slump even when you\'re successful? Where does this malaise come from? And, most importantly, will it ever end?','HNKNM',3,'302','302-3'),(22,'Think Like A Freak','Penguin Random House',2015,'Ting Anh','Now, with Think Like a Freak, Steven D. Levitt and Stephen J. Dubner have written their most revolutionary book yet. With their trademark blend of captivating storytelling and unconventional analysis, they take us inside their thought process and teach us all to think a bit more productively, more creatively, more rationally - to think, that is, like a Freak.','HNKNM',3,'302','302-3'),(23,'T in Ting Vit Dnh Cho Hc Sinh (Kh Nh)','NXB Dn Tr',2021,'Ting Vit','T in ting vit (dnh cho hc sinh) thuc Vin T in hc v Bch khoa th Vit Nam hng dn bin son c ni dung y d , lng t vng phong ph , mang tnh chnh xc cao . Cch trnh by t in khoa hc , gii thch r rng .','TDTV',3,'301','301-1'),(24,'Hn Vit T in (Ba Cng Ti Bn Ln 1-2020)','NXB i Hc Quc Gia H Ni',2020,'Ting Vit','Vi ni dung a dng, phong ph, cun sch ny s l ngun t liu hu ch  gip bn bit c nhiu t vng ting Trung, t  vic hc ting Trung s d dng hn.','TDTT',3,'301','301-1'),(25,'Thc Hnh Giao Tip Ting Nht (Sch B Ti)','NXB Tng hp TP.HCM',2012,'Ting Vit','','SHTN',3,'301','301-2'),(26,'Giao Tip Ting Anh Tht D Dng - Easy English Conversation (Ti Bn 2020)','NXB Hng c',2020,'Ting Vit','Ni dung cun sch bao gm nhng cu thoi ting Anh v nhng ch  ting Anh giao tip thng dng nht trong cuc sng hng ngy. iu c bit l nhng kin thc ny c trnh by di dng s  t duy gip ngi hc c th d dng tng hp kin thc  hc v nng cao kh nng ghi nh nhanh gp 3 ln so vi cch hc thng thng.','SHTA',3,'301','301-2'),(27,'Mind Map Vocabulary - Hc T Vng Ting Anh Bng S  T Duy','NXB Tng hp TP.HCM',2018,'Ting Vit','S  t duy (Mind Map) tuy c s dng rng ri trong nhiu lnh vc nhng dng n nh th no  t hiu qu cao nht khng phi l iu n gin.  gip bn c hng th v s t tin khi hc ting Anh, chng ti  dy cng nghin cu v bin son quyn Hc t vng ting Anh bng s  t duy. Khi hc bng s  t duy, bn s d dng lin tng n nhiu 